import axios from "axios"

var bookFunctions = {
 search: function(searchTerm){
     axios.get("https://www.googleapis.com/books/v1/volumes?q="+searchTerm).then(function(data){
         console,log(data,"data")
     })
 }
}
export default bookFunctions
